import React from 'react';
import './Header.css';
export default function Header(){
     return(
        <>
           <div className="h">
            <div className="h-top">
               <div className="links">
                  <a href="">Home</a>
                  <a href="">Academics</a>
                  <a href="">Admission</a>
                  <a href="">About Us</a>
                  <a href="">Contact Us</a>
               </div>
            </div>
            <div className="h-bottom">
                <span>कन्या</span> <span>उ. मा.</span><span> विद्यालय​</span> 
            </div>
           </div>
        </>
     )
}







